		E9AEF54918E2AF1E003BA069 /* PBXBuildRule */ = {
			isa = PBXBuildRule;
			compilerSpec = com.apple.compilers.proxy.script;
			filePatterns = "*.qrc";
			fileType = pattern.proxy;
			isEditable = 1;
			name = "Qt - Build qrc files";
			outputFiles = (
				"$DERIVED_FILE_DIR/Qt-AutoGen/qrc/qrc_${INPUT_FILE_BASE}.cpp",
			);
			script = "#create directory it's not there\nif [ ! -d \"$DERIVED_FILE_DIR/Qt-AutoGen/qrc\" ]; then\nmkdir -p \"$DERIVED_FILE_DIR/Qt-AutoGen\"\nmkdir \"$DERIVED_FILE_DIR/Qt-AutoGen/qrc\"\nfi\n\n#definitions\nRCC=$QT_DIR_PATH/Tools/rcc\n\n#now run rcc to genenrate cpp file (it will automatically be added in build)\n$RCC -name \"$INPUT_FILE_BASE\" \"$INPUT_FILE_PATH\" -o \"$DERIVED_FILE_DIR/Qt-AutoGen/qrc/qrc_${INPUT_FILE_BASE}.cpp\"";
		};
		E9AEF54A18E2AF49003BA069 /* PBXBuildRule */ = {
			isa = PBXBuildRule;
			compilerSpec = com.apple.compilers.proxy.script;
			filePatterns = "*.h";
			fileType = pattern.proxy;
			isEditable = 1;
			name = "Qt - Build moc files";
			outputFiles = (
				"$DERIVED_FILE_DIR/Qt-AutoGen/moc/moc_${INPUT_FILE_BASE}.cpp",
			);
			script = "#ensure we've Q_OBJECT macro defined in the input file\nif grep -q \"Q_OBJECT\" \"$INPUT_FILE_PATH\"; then\n\n#create directory it's not there\nif [ ! -d \"$DERIVED_FILE_DIR/Qt-AutoGen/moc\" ]; then\nmkdir -p \"$DERIVED_FILE_DIR/Qt-AutoGen\"\nmkdir \"$DERIVED_FILE_DIR/Qt-AutoGen/moc\"\nfi\n\n#definitions\nMOC=$QT_DIR_PATH/Tools/moc\nDEFINES=\"-DQT_GUI_LIB -DQT_CORE_LIB -DQT_SHARED\"\nINCPATH=\"-I$QT_PATH/usr/local/mkspecs/macx-xcode -I. -I$QT_DIR_PATH/Frameworks/QtCore.framework/Versions/4/Headers -I$QT_DIR_PATH/Frameworks/QtGui.framework/Versions/4/Headers -I/usr/include -I. -I/usr/local/include -I/System/Library/Frameworks/CarbonCore.framework/Headers -F/Library/Frameworks\"\n\n#now run moc to genenrate cpp file (it will automatically be added in build)\n$MOC \"$DEFINES\" \"$INCPATH\" -D__APPLE__ -D__GNUC__ \"$INPUT_FILE_PATH\" -o \"$DERIVED_FILE_DIR/Qt-AutoGen/moc/moc_${INPUT_FILE_BASE}.cpp\"\nfi";
